def a005811(n): return bin(n^(n>>1))[2:].count("1")
def ok(n): # This function after _Peter Luschny_
    B=bin(n)[2:] if n!=0 else 0
    s=0
    for b in B:
        s+=1 if b=="1" else -1
        if s<0: return 0
    return s==0
def A(n): return [0] + [i for i in range(1, n + 1) if ok(i)]
